Oto przykładowa klasa BankAccount napisana w języku Java . Klasa ta zawiera dokumentację kodu oraz jest poprawnie opisana . /** * Klasa reprezentująca rachunek bankowy. * * @author Jan Kowalski * @version 1.0 */
public class BankAccount { // Numer konta bankowego. private String accountNumber; // Saldo konta bankowego. private double balance; /** * Konstruktor klasy BankAccount. * @param accountNumber Numer konta bankowego. * @param balance Saldo konta bankowego. */ public BankAccount(String accountNumber, double balance) { this.accountNumber = accountNumber; this.balance = balance; } /** * Zwraca numer konta bankowego. * @return Numer konta bankowego. */ public String getAccountNumber() { return accountNumber; } /** * Zwraca saldo konta bankowego. * @return Saldo konta bankowego. */ public double getBalance() { return balance; } /** * Dokonuje wpłaty na konto bankowe. * @param amount Kwota wpłaty. */ public void deposit(double amount) { balance += amount; } /** * Dokonuje wypłaty z konta bankowego. * @param amount Kwota wypłaty. */ public void withdraw(double amount) { balance -= amount; }
} Dokumentacja kodu w Javie jest tworzona za pomocą komentarzy . Komentarze w Javie mogą być tworzone na dwa sposoby: // To jest komentarz. /* To jest komentarz. */ W tym przykładzie dokumentacja zawiera następujące informacje : nazwa klasy - BankAccount autor - Jan Kowalski wersja - 1.0 opis ogólny - klasa reprezentująca rachunek bankowy. opis pól: accountNumber - numer konta bankowego. balance - saldo konta bankowego. opis metod: getAccountNumber() - zwraca numer konta bankowego. getBalance() - zwraca saldo konta bankowego. deposit() - dokonuje wpłaty na konto bankowe. withdraw() - dokonuje wypłaty z konta bankowego.
